    id:4,
    title:'This is my fourth post',
    body:'This is the body of my fourth post',
    img:"https://source.unsplash.com/random"
  }
]

const Home=() =>{
  return (
    <div className='home'>
      <div className="posts">
        {posts.map(post =>(
          <div className='post' key={post.id}>
            <div className='img'>
            <img src={post.img} alt=""/>
          </div>
          </div>
        ))
        }

      </div>

      </div>
  )
}

export default Home
